Cal.prototype.backToCurrMonth = function () {
	this.cpt = -1;
	var d = new Date();
	var year = d.getFullYear();
	var month = d.getMonth();
	this.currYear = year;
	this.currMonth = month;
	this.checkLastMonth(year, (month - 1));
	this.showMonth(year, month);
	$('.today').trigger('click');
	$('#btnPrev').addClass('inactive');
};

